    display:flex;
    height:20em;
    width:15em;
    border: 10px solid var(--s-3);
` 

export default function Values() {
    return (
        <ValuesWrapper>
            <ValueCard>
                minimal
            </ValueCard>
            <ValueCard>
                mobile first 
            </ValueCard>
            <ValueCard>
                component based
            </ValueCard>



        </ValuesWrapper>
    )
}
